searchTable[29]={Type:"Application",Title:"<img src='../Standard/APPL.ICO.gif'/> <a title='EUROMILLIONS' href='A911B0E556DE7F1D.htm'>EUROMILLIONS</a>",Comment:"Début des prises de jeu le samedi 7 février 2004.<br/>1er tirage le vendredi 13 février 2004.<br/>L'administration centrale du jeu est confiée au SLE dont le rôle est d'assurer, notamment, le tirage, le calcul des rapports et la gestion des transferts de fonds entre ses membres par l'intermédiaire d'un Trust britannique. <br/>L'intégrité du jeu repose, pour l'essentiel, sur les fichiers de combinaison (CombiFile) qui sont transmis par chacune des loteries au SLE avant le début du tirage.<br/><br/>Le jeu Euro Millions est une coordination de jeux nationaux, reposant sur le respect de règles et principes communs. Chaque loterie reste seule opératrice du jeu sur son territoire, dans le respect des contraintes réglementaires s'y appliquant. La collecte des mises et le paiement des gains restent de la seule responsabilité des opérateurs, alors que les gains sont attribués à partir de l'ensemble des mises des joueurs sur tous les territoires concernés. Le jeu est donc géré en masse commune.  Le jeu qui a vocation à être lancé dans plusieurs pays d'Europe Occidentale, accueille depuis le tirage du 8 octobre les loteries d'Autriche, de Belgique, d'Irlande, du Luxembourg, du Portugal, de Suisse Alémanique et de Suisse Romande.<br/><br/>LE JEU<br/>Jeu de répartition<br/>Le taux de redistribution aux joueurs est de 50% net.<br/><br/>Jeu Simple <br/>Le joueur coche 5 numéros et 2 étoiles par grille<br/><br/>Système Flash, 3 possibilités :<br/>- le joueur peut cocher moins de 5 numéros et 2 étoiles par grille => les grilles sont complétées aléatoirement par le terminal de jeu,<br/>- le joueur peut uniquement cocher la case « Système Flash » située en dessous de la grille : le terminal attribue au hasard les 5 numéros + 2 étoiles par grille,<br/>- le joueur peut demander directement au détaillant un jeu simple « Système Flash » sans utiliser de bulletin.<br/><br/>Jeu Multiple <br/>Le joueur peut cocher jusqu'à 9 numéros et/ou 9 étoiles par grille<br/><br/>Système Flash :<br/>Le joueur peut demander directement au détaillant un jeu multiple « Système Flash » sans utiliser de bulletin.<br/><br/>Abonnement<br/>Le joueur peut s'abonner pour 2, 3, 4 ou 5 semaines.<br/><br/>LE TIRAGE <br/>Deux rendez-vous tous les vendredis sur TF1.<br/>A 20h50 : rappel du montant du Jackpot + rappel du tirage effectué dans la soirée.<br/>Vers 23h00 (après le prime-time) : tirage des 5 numéros et des 2 étoiles.<br/><br/>LE TABLEAU DE GAINS <br/>Pour gagner, il faut avoir trouvé :<br/>·	1er rang        : 5 numéros et 2 étoiles<br/>·	2ème rang   : 5 numéros et 1 étoile<br/>·	3ème rang   : 5 numéros et 0 étoile<br/>·	4ème rang   : 4 numéros et 2 étoiles<br/>·	5ème rang   : 4 numéros et 1 étoile<br/>·	6ème rang   : 4 numéros et 0 étoile<br/>·	7ème rang   : 3 numéros et 2 étoiles<br/>·	8ème rang   : 3 numéros et 1 étoile<br/>·	9ème rang   : 2 numéros et 2 étoiles<br/>·	10ème rang : 3 numéros et 0 étoile<br/>·	11ème rang : 1 numéro et 2 étoiles<br/>·	12ème rang : 2 numéros et 1 étoile<br/>En cas d'absence de gagnant au 1er rang d'un tirage dans tous les pays participants, les gains de ce rang sont remis en jeu de semaine en semaine, jusqu'à ce qu'un tirage désigne au moins un gagnant dans l'un de ces pays.",Date:"2020/03/31 09:38:50"};
